import React from 'react';
import {
    Switch,
    Route,
    useLocation,
    useRouteMatch,
    useHistory,
} from 'react-router-dom';

import Sidebar from '../Sidebar/Sidebar';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import Logout from '../pages/Login/Logout';

import Explore from '../pages/Explore/Explore';
import Home from '../pages/Home/Home';
import Account from '../pages/Account/Account';
import Lessons from '../pages/Lessons/Lessons';
import SingleLesson from '../pages/SingleLesson/SingleLesson';

import './styles.scss';

function Dashboard() {
    return (
        <>
            <Sidebar />
            <Header />
            <div className="dashboard-content" id="main-content">
                <div className="spacer" id="header_spacer"></div>
                <Route path="/main/explore">
                    <Explore />
                </Route>
                <Route path="/main/home">
                    <Home />
                </Route>
                <Route path="/main/logout">
                    <Logout />
                </Route>
                <Route path="/main/account">
                    <Account />
                </Route>
                <Route path="/main/lessons">
                    <Lessons />
                </Route>
                <Route path="/main/lesson/:lesson_hash">
                    <SingleLesson />
                </Route>
            </div>
            <Footer />
        </>
    );
}

export default Dashboard;
